INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (1, 3, 12300150, 3001, 0, "ん～はっきり言って微妙ね！\nま、難しい問題だし、\n勉強すれば\n点数は上がっていくと思うわ！", 2, "vo_minigame_1012_result_1082", 1, 5, 2.46, 9, 2);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (1, 3, 12300151, 3001, 0, "ん～…\n10点には届かなかったか～\n次は10点越え目指して\n頑張ってみない？", 2, "vo_minigame_1012_result_1083", 1, 5, 2.94, 9, 2);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (1, 7, 12300152, 3001, 0, "はいお疲れ～\n点数的にはまあまあってとこね！\nま、超難問だし頑張ったわよ", 2, "vo_minigame_1012_result_1084", 1, 5, 4.19, 9, 3);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (1, 1, 12300153, 3001, 0, "うん、かなり難しい問題なのに\n最後までやり遂げたわね\n次はもっといい点目指してみる？", 2, "vo_minigame_1012_result_1085", 1, 5, 0.0, 9, 3);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (1, 3, 12300154, 3001, 0, "ちょっとミスが多かったかもね～\nでも間違えた所は復習して\n次は正解するわよー！", 2, "vo_minigame_1012_result_1086", 1, 5, 2.63, 9, 3);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (1, 3, 12300155, 3001, 0, "あら…あんまり良くない点数ね～\nどうしたの、調子でも悪かった？\n次はもっと頑張りましょうか", 2, "vo_minigame_1012_result_1087", 1, 1, 5.53, 4, 1);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (1, 3, 12300156, 3001, 9, "ん～…正解数は\n物足りないわね～\nもうちょっと勉強の時間\n増やしちゃおっか？", 2, "vo_minigame_1012_result_1088", 3, 1, 0.01, 4, 1);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (1, 3, 12300157, 3001, 3, "ん～…あんたならもうちょと\nいい点取れんでしょ～？\nもっと頑張んなさいよ\n期待してやってんだからさ！", 2, "vo_minigame_1012_result_1089", 1, 1, 4.15, 4, 1);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (1, 9, 12300158, 3001, 9, "ん～今のあんたには、\nこの問題は難しかったかしら…\n難易度下げてチャレンジするのも\nありかもね～？", 2, "vo_minigame_1012_result_1090", 9, 1, 0.01, 4, 2);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (1, 3, 12300159, 3001, 0, "あんまり出来は良くないわね～\n難しい問題だししょうがないけど\n次はもっと頑張ってほしいわ！", 2, "vo_minigame_1012_result_1091", 1, 1, 5.37, 4, 2);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (1, 3, 12300160, 3001, 0, "なるほど…\nちょっと苦手な問題が多かった？\nもう一度チャレンジ\nしてみましょうか～", 2, "vo_minigame_1012_result_1092", 1, 1, 1.44, 4, 2);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (1, 3, 12300161, 3001, 0, "んん～…問題が難しすぎた？\n無理に難しい問題続けるより、\n難易度下げた方が\n勉強の効率良いかもよ～？", 2, "vo_minigame_1012_result_1093", 3, 1, 0.0, 4, 3);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (1, 3, 12300162, 3001, 3, "…あんまり点数取れなかったわね\nこれはあたしにも難しい問題だし\nそう落ち込まなくても大丈夫！\n次頑張りましょ！", 2, "vo_minigame_1012_result_1094", 9, 1, 2.91, 4, 3);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (1, 5, 12300163, 3001, 0, "ごめん、ちょっと難しすぎた？\nもう一度チャレンジするも良し、\n難易度を下げるも良し、\nあんたがやる気なら付き合うわ！", 2, "vo_minigame_1012_result_1095", 1, 1, 2.61, 4, 3);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (1, 4, 12300164, 3001, 1, "ちょっとあんた…\nやる気ないわよね～！？\n次こんな点数取ったら\n怒るわよ！", 2, "vo_minigame_1012_result_1096", 2, 0, 3.63, 0, 1);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (1, 6, 12300165, 3001, 1, "はあ…自分で何点取ったか\n分かってるわよね～…？\n０点よ０点！　舐めてんの！？", 2, "vo_minigame_1012_result_1097", 2, 0, 4.16, 0, 1);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (1, 3, 12300166, 3001, 6, "うう～頭痛い…\nあんたのせいよ！\nなに０点って！\nはあ、このままじゃ赤点よ～…", 2, "vo_minigame_1012_result_1098", 3, 0, 0.01, 0, 1);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (1, 6, 12300167, 3001, 0, "ねえ、あんた本気でやったの？\nまさか適当にやるわけないわよね\n…分かった、\nもう一回チャレンジするのよ！", 2, "vo_minigame_1012_result_1099", 2, 0, 5.75, 0, 2);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (1, 4, 12300168, 3001, 1, "あ…あんた、０点よ０点…！\nあたしの教え方が悪かった…？\n…燃えてきたわ！\n絶対あんたの学力上げてやる！", 2, "vo_minigame_1012_result_1100", 2, 0, 5.64, 0, 2);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (1, 8, 12300169, 3001, 8, "ちょっと待って採点ミスかも…\n…いや合ってるわね。はい０点\n…って０点！？\nふざけんなーー！", 2, "vo_minigame_1012_result_1101", 4, 0, 5.73, 0, 2);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (1, 5, 12300170, 3001, 1, "あらら…０点よ\nま、難しい問題だしね…\n…つっても０点は無いわ！\n一問くらい正解しなさいよ！", 2, "vo_minigame_1012_result_1102", 3, 0, 5.32, 0, 3);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (1, 3, 12300171, 3001, 9, "残念だけど０点よ\nま、まあ前向きにとらえるなら、\n今が底よ！　どん底！\nあとは上がってくだけね！", 2, "vo_minigame_1012_result_1103", 9, 0, 2.37, 0, 3);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (1, 9, 12300172, 3001, 3, "…かなり出来が悪いわね\n一旦休憩しましょうか？\nリフレッシュして頭切り替えて\nもう一度頑張りましょう！", 2, "vo_minigame_1012_result_1104", 1, 0, 4.25, 0, 3);
